import React from 'react';
import Navbar from "./components/Navbar";
import Skills from "./components/Skills";
import PersonalInfo from "./components/PersonalInfo";
import './styles.css';

function App() {
  return (
    <div>
      {/* Navigation Bar */}
      <Navbar />  {/* Include Navbar component here */}

      {/* Floating Navigation */}
      <div className="floating-nav">
        <a href="#section3" className="nav-item">Welcome</a>
        <a href="#skills" className="nav-item">Skills</a>
        <a href="#section3" className="nav-item">Projects</a>
      </div>

      {/* Personal Info */}
      <PersonalInfo />  {/* Include PersonalInfo component here */}
      <img src={`${process.env.PUBLIC_URL}/images/IMG_0881.webp`} alt="Ryan's headshot" />

      {/* Skills Section */}
      <Skills />

      {/* Projects Section */}
      <section id="Projects">
        {/* Add content here */}
      </section>

      {/* Info Section */}
      <section id="Info">
        {/* Add content here */}
      </section>
    </div>
  );
}
export default App;
